  Raj (Ram Charan Tej) is called as betting  
  Raj because of his obsession for betting.  
  James (Ajmal) is his betting enemy. Raj    
  wants 20 lacs for the surgery of his       
  adopted father. James is ready to offer 20 
  lacs as betting amount if Raj woos and wins
  over Chaitra (Tamanna). Chaitra is the     
  daughter of a billionaire Bellary (Mukesh  
  Rishi) The rest of the story is all about  
  how Raj makes Chaitra fall for him and the 
  troubles that follow.                      





